    let realTime=null
    function checkTime(i) {
        if (i < 10) {i = "0" + i};  // add zero in front of numbers < 10
        return i;
      }

    let today = new Date();
    let h = today.getHours();
    let m = today.getMinutes();
    let s = today.getSeconds();
    m = checkTime(m);
    s = checkTime(s);
    realTime= h + ":" + m + ":" + s;
    //let t = setTimeout(startTime, 500);



    return (
      <div>
          <p>Time</p>
        <p>{realTime}</p>
      </div>
    )
  }

